import React, { Component } from 'react'

class clickCounter extends Component {
  render() {
    const {count, incrementCount} = this.props
    return (
      <div>
        <button onClick={incrementCount}>  CLick {count}</button>
      </div>
    )
  }
}

export default clickCounter
